INSERT INTO `pages` (`id`, `title`, `description`, `slug`, `image`, `meta_title`, `meta_description`, `meta_keywords`, `status`, `created_by`, `deleted_at`, `created`, `modified`) VALUES
(4,	'About Us',	'<p>Founded on the principles of durability and reliability, <strong>Pinder Workwear</strong> was born from a need for better workwear solutions. We saw a gap in the market for high-quality, affordable clothing that could withstand the rigors of demanding jobs.&nbsp;</p>\r\n\r\n<p>Our journey began with <strong>Pinders Schoolwear, </strong>supplying uniforms for schools all over the UK. Today, we&#39;re a leading online retailer of schoolwear, offering a wide range of school products from trusted brands.&nbsp;</p>\r\n\r\n<p>We believe that everyone deserves workwear that&#39;s built to last. We&#39;re passionate about providing professionals with durable, comfortable, and functional clothing that meets the challenges of their daily work. Our commitment to quality, value, and customer satisfaction drives everything we do. We strive to create a seamless online shopping experience, so you can easily find the workwear you need and get back to what matters most.</p>\r\n\r\n<p>We&#39;re dedicated</p>\r\n\r\n<div _ngcontent-ng-c2860376468=\"\" class=\"container\">&nbsp;</div>\r\n\r\n<p>&nbsp;</p>',	'about-us',	NULL,	'About Us | Pinders Workwear',	'Explore a wide range of workwear clothing for all trades. Find everything from work boots and safety gear to comfortable and functional apparel.',	'Pinders Workwear',	1,	NULL,	NULL,	'2024-03-31 14:56:35',	'2025-03-15 14:39:46'),
(5,	'FAQs',	'<p><strong>Where can I find the size guide for my workwear?</strong><br />\r\nThe Size Chart can be viewed on each product page by clicking the yellow Size Chart button.</p>\r\n\r\n<p><strong>What is your lead time for standard orders?</strong> (no customisation)<br />\r\nWe keep our most popular items in stock for immediate dispatch and it is our aim to deliver your items as quickly as possible, usually next day or within three working days.<br />\r\nStocked items will show a &quot;Next Day Delivery&quot; sign over the products image on the product page.&nbsp;</p>\r\n\r\n<p>You will be provided with tracking details so that you can track your delivery directly.&nbsp;<br />\r\nTrack your order on - <a href=\"https://www.parcelforce.com/track-trace\" target=\"_blank\">https://www.parcelforce.com/track-trace</a></p>\r\n\r\n<p><strong>What is your lead time for customised workwear?</strong><br />\r\nWe aim to have your workwear customised and dispatched as quickly as possible.<br />\r\nThe average time is between 5 to 7 working days depending on the size of the order and the level of customisation required.<br />\r\nFor customised orders with a new logo, our design team will send you an initial proof within 24-48 hours of your order being placed.<br />\r\nOnce you have approved the design we will begin production immediately.<br />\r\nIf we already have your logo/artwork on file we don&#39;t require you to resend it so no proof is required which will speed up the process.</p>\r\n\r\n<p>WORKING DAYS<br />\r\nWorking days are classed as Monday to Friday and exclude Bank Holidays.</p>\r\n\r\n<p><strong>Do you offer discounts for large workwear orders?</strong><br />\r\nIf you wish to place a large order or buy workwear in bulk and would like to discuss pricing, please feel free to call us on <a href=\"tel:0114-2513275\">0114-2513275</a>&nbsp;or contact us via email to discuss your requirements. Please email us on <a href=\"mailto:contact@pindersworkwear.com?subject=Bulk%20Order\">contact@pindersworkwear.com</a><br />\r\nWe will be more than happy to work with you and provide the most competitive quote as quickly as possible.</p>\r\n\r\n<p><strong>Do you charge for delivery?</strong><br />\r\nUK Delivery Charges<br />\r\nAll Mainland UK orders over &pound;100 + VAT automatically receive free delivery.<br />\r\nIf your order is under &pound;100, delivery will be charged at &pound;6.00+VAT</p>\r\n\r\n<p>If you are unsure about any aspect of our delivery service or your order is required urgently, please let us know and we will endeavour to meet your requirements. Feel free to call us on <a href=\"tel:0114-2513275\">0114-2513275</a>&nbsp;or contact us via email,&nbsp;<a href=\"mailto:contact@pindersworkwear.com?subject=Bulk%20Order\">contact@pindersworkwear.com</a> to discuss your requirements.&nbsp;</p>\r\n\r\n<p><strong>Additional Information</strong></p>\r\n\r\n<p>&bull; All delivery timescales are estimates but rest assured we will do everything possible to deliver your order as quickly as possible.<br />\r\n&bull; Parcelforce is our main courier but we may use Royal Mail for international deliveries.&nbsp;<br />\r\n&bull; You will be provided with full tracking information and notified of the day and time when delivery will be made.<br />\r\n&bull; All orders are dispatched on a fully insured, express delivery service.<br />\r\n&bull; All delivery prices are based on a maximum of 10kg - if your consignment does not fit within these parameters we reserve the right to contact you for extra payment.</p>\r\n\r\n<p><strong>Do you provide a warranty on your products?</strong><br />\r\nYes, all of our products on our website are covered by a manufacturer&#39;s warranty.<br />\r\nDue to the large range of products that we sell and the different warranties provided by each manufacturer it isn&#39;t possible to list them all here.<br />\r\nIf you would like to know the warranty for specific products or brands, please contact us via phone on <a href=\"tel:0114-2513275\">0114-2513275</a>&nbsp;or contact us via email,&nbsp;<a href=\"mailto:contact@pindersworkwear.com?subject=Bulk%20Order\">contact@pindersworkwear.com</a></p>\r\n\r\n<p>&nbsp;</p>',	'faqs',	NULL,	'FAQs',	NULL,	NULL,	1,	NULL,	NULL,	'2024-03-31 14:56:35',	'2025-06-09 13:31:59'),
(6,	'Terms & Conditions',	'<h2>Who we are</h2>\r\n\r\n<p>Our website address is:&nbsp;<a href=\"mailto:info@example.com\">info@example.com</a></p>\r\n\r\n<h2>What personal data we collect and why we collect it</h2>\r\n\r\n<h3>Comments</h3>\r\n\r\n<p>When visitors leave comments on the site we collect the data shown in the comments form, and also the visitor&rsquo;s IP address and browser user agent string to help spam detection.</p>\r\n\r\n<p>An anonymized string created from your email address (also called a hash) may be provided to the Gravatar service to see if you are using it. The Gravatar service privacy policy is available here: https://automattic.com/privacy/. After approval of your comment, your profile picture is visible to the public in the context of your comment.</p>\r\n\r\n<h3>Media</h3>\r\n\r\n<p>If you upload images to the website, you should avoid uploading images with embedded location data (EXIF GPS) included. Visitors to the website can download and extract any location data from images on the website.</p>\r\n\r\n<h3>Cookies</h3>\r\n\r\n<p>If you leave a comment on our site you may opt-in to saving your name, email address and website in cookies. These are for your convenience so that you do not have to fill in your details again when you leave another comment. These cookies will last for one year.</p>\r\n\r\n<p>If you have an account and you log in to this site, we will set a temporary cookie to determine if your browser accepts cookies. This cookie contains no personal data and is discarded when you close your browser.</p>\r\n\r\n<p>When you log in, we will also set up several cookies to save your login information and your screen display choices. Login cookies last for two days, and screen options cookies last for a year. If you select &ldquo;Remember Me&rdquo;, your login will persist for two weeks. If you log out of your account, the login cookies will be removed.</p>\r\n\r\n<p>If you edit or publish an article, an additional cookie will be saved in your browser. This cookie includes no personal data and simply indicates the post ID of the article you just edited. It expires after 1 day.</p>\r\n\r\n<h3>Embedded content from other websites</h3>\r\n\r\n<p>Articles on this site may include embedded content (e.g. videos, images, articles, etc.). Embedded content from other websites behaves in the exact same way as if the visitor has visited the other website.</p>\r\n\r\n<p>These websites may collect data about you, use cookies, embed additional third-party tracking, and monitor your interaction with that embedded content, including tracking your interaction with the embedded content if you have an account and are logged in to that website.</p>\r\n\r\n<h2>How long we retain your data</h2>\r\n\r\n<p>If you leave a comment, the comment and its metadata are retained indefinitely. This is so we can recognize and approve any follow-up comments automatically instead of holding them in a moderation queue.</p>\r\n\r\n<p>For users that register on our website (if any), we also store the personal information they provide in their user profile. All users can see, edit, or delete their personal information at any time (except they cannot change their username). Website administrators can also see and edit that information.</p>\r\n\r\n<h2>What rights you have over your data</h2>\r\n\r\n<p>If you have an account on this site, or have left comments, you can request to receive an exported file of the personal data we hold about you, including any data you have provided to us. You can also request that we erase any personal data we hold about you. This does not include any data we are obliged to keep for administrative, legal, or security purposes.</p>\r\n\r\n<h2>Where we send your data</h2>\r\n\r\n<p>Visitor comments may be checked through an automated spam detection service.</p>',	'terms-conditions',	NULL,	NULL,	NULL,	NULL,	1,	NULL,	NULL,	'2024-03-31 14:56:35',	'2024-03-31 09:54:48'),
(7,	'Privacy Policy',	'<p>This privacy policy sets out how Pindersworkwear.com uses and protects any information that you give Pindersworkwear.com when you use this website.</p>\r\n\r\n<p>Pindersworkwear.com is committed to ensuring that your privacy is protected. Should we ask you to provide certain information by which you can be identified when using this website, then you can be assured that it will only be used in accordance with this privacy statement.</p>\r\n\r\n<p>Pindersworkwear.com may change this policy from time to time by updating this page. You should check this page from time to time to ensure that you are happy with any changes.</p>\r\n\r\n<p><strong>What We Collect</strong><br />\r\nWe may collect the following information:<br />\r\n&nbsp; &nbsp; Name and payment details<br />\r\n&nbsp; &nbsp; Contact information including email address<br />\r\n&nbsp; &nbsp; Demographic information such as postcode, preferences and interests<br />\r\n&nbsp; &nbsp; Other information relevant to customer surveys and/or offers</p>\r\n\r\n<p><strong>How We Use The Information We Collect</strong><br />\r\nWe require this information to understand your needs and provide you with a better service, and in particular for the following reasons:<br />\r\n&nbsp; &nbsp; To process your order and obtain payment<br />\r\n&nbsp; &nbsp; Internal record keeping<br />\r\n&nbsp; &nbsp; We may use the information to improve our products and services<br />\r\n&nbsp; &nbsp; We may periodically send promotional emails about new products, special offers or other information which we think you may find interesting using the email address which you have provided<br />\r\n&nbsp; &nbsp; From time to time, we may also use your information to contact you for market research purposes. We may contact you by email, phone, fax or mail. We may use the information to customise the website according to your interests</p>\r\n\r\n<p><strong>Security</strong><br />\r\nWe are committed to ensuring that your information is secure. In order to prevent unauthorised access or disclosure, we have put in place suitable physical, electronic and managerial procedures to safeguard and secure the information we collect online.</p>\r\n\r\n<p><strong>How We Use Cookies</strong>&nbsp;<br />\r\nA cookie is a small file which asks permission to be placed on your computer&#39;s hard drive. Once you agree, the file is added and the cookie helps analyse web traffic or lets you know when you visit a particular site. Cookies allow web applications to respond to you as an individual. The web application can tailor its operations to your needs, likes and dislikes by gathering and remembering information about your preferences.</p>\r\n\r\n<p>We use traffic log cookies to identify which pages are being used. This helps us analyse data about web page traffic and improve our website in order to tailor it to customer needs. We only use this information for statistical analysis purposes and then the data is removed from the system.</p>\r\n\r\n<p>Overall, cookies help us provide you with a better website, by enabling us to monitor which pages you find useful and which you do not. A cookie in no way gives us access to your computer or any information about you, other than the data you choose to share with us.</p>\r\n\r\n<p>You can choose to accept or decline cookies. Most web browsers automatically accept cookies, but you can usually modify your browser setting to decline cookies if you prefer. This may prevent you from taking full advantage of the website.</p>\r\n\r\n<p><strong>List of Cookies We Collect</strong><br />\r\nThe table below lists the cookies we collect and the information they store.</p>\r\n\r\n<p>COOKIE name&nbsp; &nbsp; &nbsp;COOKIE Description</p>\r\n\r\n<p>CART&nbsp; &nbsp; &nbsp;The association with your shopping cart.</p>\r\n\r\n<p>CATEGORY_INFO&nbsp; &nbsp; &nbsp;Allows pages to be displayed more quickly.</p>\r\n\r\n<p>COMPARE&nbsp; &nbsp; &nbsp;The items that you have in the Compare Products list.</p>\r\n\r\n<p>CUSTOMER&nbsp; &nbsp; &nbsp;An encrypted version of your customer id.</p>\r\n\r\n<p>CUSTOMER_AUTH&nbsp; &nbsp; &nbsp;An indicator if you are signed into the store.</p>\r\n\r\n<p>CUSTOMER_INFO&nbsp; &nbsp; &nbsp;An encrypted version of the customer group you belong to.</p>\r\n\r\n<p>CUSTOMER_SEGMENT_IDS&nbsp; &nbsp; &nbsp;Stores your Customer Segment ID</p>\r\n\r\n<p>EXTERNAL_NO_CACHE&nbsp; &nbsp; &nbsp;A flag that, indicates whether caching is on or off.</p>\r\n\r\n<p>FRONTEND&nbsp; &nbsp; &nbsp;Your session ID on the server.</p>\r\n\r\n<p>GUEST-VIEW&nbsp; &nbsp; &nbsp;Allows guests to edit their orders.</p>\r\n\r\n<p>LAST_CATEGORY&nbsp; &nbsp; &nbsp;The last category you visited.</p>\r\n\r\n<p>LAST_PRODUCT&nbsp; &nbsp; &nbsp;The last product you looked at.</p>\r\n\r\n<p>NEWMESSAGE&nbsp; &nbsp; &nbsp;Indicates whether a new message has been received.</p>\r\n\r\n<p>NO_CACHE&nbsp; &nbsp; &nbsp;Indicates whether it is allowed to use cache.</p>\r\n\r\n<p>PERSISTENT_SHOPPING_CART&nbsp; &nbsp; &nbsp;A link to information about your cart and viewing history if you have asked the site.</p>\r\n\r\n<p>RECENTLYCOMPARED&nbsp; &nbsp; &nbsp;The items you recently compared.</p>\r\n\r\n<p>STF&nbsp; &nbsp; &nbsp;Information on products you emailed to friends.</p>\r\n\r\n<p>STORE&nbsp; &nbsp; &nbsp;The store view or language you have selected.</p>\r\n\r\n<p>USER_ALLOWED_SAVE_COOKIE&nbsp; &nbsp; &nbsp;Indicates whether a customer authorized cookies.</p>\r\n\r\n<p>VIEWED_PRODUCT_IDS&nbsp; &nbsp; &nbsp;The products that you recently looked at.</p>\r\n\r\n<p>WISHLIST&nbsp; &nbsp; &nbsp;An encrypted list of products added to your wish list.</p>\r\n\r\n<p>WISHLIST_CNT&nbsp; &nbsp; &nbsp;The number of items in your wish list.</p>\r\n\r\n<p><strong>Links To Other Websites</strong><br />\r\nWe are committed to ensuring that your information is secure. In order to prevent unauthorized access or disclosure, we have put in place suitable physical, electronic and managerial procedures to safeguard and secure the information we collect online.</p>\r\n\r\n<p><strong>Data Aggregation, Analytics and Profile Creation</strong><br />\r\nWe may analyse your browsing behaviour to draw inferences and create profiles about your personal preferences and behaviours. We may then use such information for the purposes described below;</p>\r\n\r\n<p>Behavioural advertising and cross platform targeting</p>\r\n\r\n<p>(a) Served by us</p>\r\n\r\n<p>We may use your information (including profile data) to serve you with advertising, which is relevant to you, on our websites and the websites of third parties.</p>\r\n\r\n<p>(b) Served by third parties on our websites</p>\r\n\r\n<p>Advertisers or other third parties using our website may also engage in behavioural advertising and use cookies and web beacons in the manner described above. We do not control these advertisers or other parties&#39; use of cookies or web beacons or what they do with the information they collect.</p>\r\n\r\n<p>(c) Served by third parties on third party websites</p>\r\n\r\n<p>We may provide your personal information (including profile data) to third parties who may then use it in combination with personal information that they have collected from you to serve you with relevant advertising on third party websites.</p>\r\n\r\n<p><strong>Controlling Your Personal Information</strong><br />\r\nYou may choose to restrict the collection or use of your personal information in the following ways:</p>\r\n\r\n<p>&nbsp; &nbsp; Whenever you are asked to fill in a form on the website, look for the box that you can click to indicate that you do not want the information to be used by anybody for direct marketing purposes</p>\r\n\r\n<p>&nbsp; &nbsp; If you have previously agreed to us using your personal information for direct marketing purposes, you may change your mind at any time by writing to or emailing us</p>\r\n\r\n<p>We will not sell, distribute or lease your personal information to third parties unless we have your permission or are required by law to do so. We may use your personal information to send you promotional information about third parties which we think you may find interesting if you tell us that you wish this to happen.</p>\r\n\r\n<p>You may request details of personal information which we hold about you under the Data Protection Act 2018. If you would like a copy of the information held on you please write to us.</p>\r\n\r\n<p>If you believe that any information we are holding on you is incorrect or incomplete, please write to or email us as soon as possible. We will promptly correct any information found to be incorrect.</p>\r\n\r\n<p><strong>Online Account Registration</strong><br />\r\nTo make online shopping faster and easier, you may register on the Pinders Workwear website. As a registered customer, you only have to enter your shipping addresses and billing information once; they will be securely stored with us for your future use. Using your name and a password of your choice, you may access your account online at any time to add, delete, or change information. If you are using a public computer, we strongly encourage you to Sign Out when you finish shopping. Your information will still be stored with us but it will not be accessible to anyone else from that computer.</p>\r\n\r\n<p><strong>Emails</strong><br />\r\nYou will receive promotional emails from us only if you have asked to receive them. If you do not want to receive email from us you can click on the &quot;Unsubscribe&quot; link at the bottom of any email communication sent by us. Please allow us 3 business days from when the request was received to complete the removal, as some of our promotions may already have been in process before you submitted your request.</p>\r\n\r\n<p><strong>Acceptance</strong><br />\r\nBy using this website, you accept the policies set forth in this Privacy Policy.<br />\r\nIf you have any questions or issues to discuss please Contact Us</p>\r\n\r\n<p>&nbsp;</p>',	'privacy-policy',	NULL,	'Privacy Policy',	NULL,	NULL,	1,	NULL,	NULL,	'2024-03-31 14:56:35',	'2025-06-09 13:52:33'),
(8,	'Delivery Information',	'<p>All of our orders are sent via Parcelforce delivery.</p>\r\n\r\n<p>Standard Delivery - 5-7 working days - &pound;6.00 +VAT</p>\r\n\r\n<p>It is important to note that all of our garments are made to order. If we do not have the items you require in stock, your order will take longer to process as the garments will need to come from our supplier. Once the garment arrives and has been Embroidered or Printed we will send it out straight away.</p>\r\n\r\n<p>Orders can be tracked and traced during each process of the delivery.</p>\r\n\r\n<p>Track your order on - <a href=\"https://www.parcelforce.com/track-trace\" target=\"_blank\">https://www.parcelforce.com/track-trace</a></p>\r\n\r\n<p><strong>Customer Services</strong><br />\r\nWe ensure your order is delivered to you promptly, safely and at low cost and as you&rsquo;d expect, our customer service team is always on hand to answer any questions you may have.</p>\r\n\r\n<p>Phone:&nbsp;<a href=\"tel:0114-2513275\">0114-2513275</a><br />\r\nEmail: <a href=\"mailto:contact@pindersworkwear.com\">contact@pindersworkwear.com</a></p>\r\n\r\n<p>Monday - Friday: 9am to 5pm</p>\r\n\r\n<p>&nbsp;</p>',	'delivery-information',	NULL,	'Delivery Information',	NULL,	NULL,	1,	NULL,	NULL,	'2024-03-31 14:56:35',	'2025-06-09 13:36:00'),
(9,	'Return Policy',	'<p><strong>Returning An Item</strong><br />\r\nWe hope that you will be delighted with your purchase from Pindersworkwear.com, but we understand that sometimes there may be a reason that you would like to return an item you have purchased to us. We aim to make this process as simple as possible.</p>\r\n\r\n<p><strong>Let us handle it</strong><br />\r\nIf you have received the wrong item/s or your items are faulty, Kindly follow the below:<br />\r\n1 Contact us by phone or email with your order number<br />\r\n2 Return the unworn garments to us in their original packaging<br />\r\n3 Leave the rest to us! We&rsquo;ll provide a full refund to your original payment method within 7 working days of receiving the returned items</p>\r\n\r\n<p><strong>IF WE CANT ACCEPT A RETURN?</strong><br />\r\nWe cannot provide returns on customised items that are not faulty. For that reason, we ask you to take your time when designing your custom clothing before submitting them for production. Before placing your order, please be careful and check product size information. We supply garments from all different manufacturers so a medium in one brand may be different to a medium in another brand, so please ensure you have checked the sizing information before you proceed.</p>\r\n\r\n<p><strong>Contact</strong></p>\r\n\r\n<p>Phone:&nbsp;<a href=\"tel:0114-2513275\">0114-2513275</a><br />\r\nEmail: <a href=\"mailto:contact@pindersworkwear.com\">contact@pindersworkwear.com</a></p>\r\n\r\n<p>Monday - Friday: 9am to 5pm</p>\r\n\r\n<p>&nbsp;</p>',	'return-policy',	NULL,	'Return Policy',	NULL,	NULL,	1,	NULL,	NULL,	'2024-03-31 14:56:35',	'2025-06-09 13:39:46'),
(10,	'Join Our Newsletter',	'<p>Enter your email address to subscribe our notification of our new post &amp; features by email.</p>',	'newsletter',	'/uploads/pages/17359899042430-jansale2025.jpg',	NULL,	NULL,	NULL,	0,	NULL,	NULL,	'2024-03-31 14:56:35',	'2025-03-16 18:45:00');
