INSERT INTO `ratings` (`id`, `image_status`, `name`, `designation`, `message`, `rating`, `image`, `status`, `created_by`, `deleted_at`, `created`, `modified`) VALUES
(6,	0,	'Nike Mardson',	'Office Work',	'This workwear is the real deal. I\'ve put it through the wringer, and it still looks and feels great. You can tell they use high-quality materials.',	4,	'/uploads/ratings/1711258056417-testimonial-thumb31.png',	1,	7,	NULL,	'2024-03-24 10:47:13',	'2025-03-17 23:29:19'),
(7,	0,	'David Anderson',	'Heavy Equipment Mechanic',	'I\'m a heavy equipment mechanic. I need clothing that can stand up to grease, grime, and sharp metal. These work coveralls have exceeded my expectations.',	5,	NULL,	1,	7,	NULL,	'2025-03-17 23:30:45',	'2025-03-17 23:30:45'),
(8,	0,	'Cathy Seas',	'Trainer',	'These work pants are so comfortable, I almost forget I\'m wearing them. The flexible material is a game-changer.',	4,	NULL,	1,	7,	NULL,	'2025-03-17 23:32:12',	'2025-03-17 23:32:12'),
(9,	0,	'Jimmy Katich',	'Electrician',	'I love the wide range of workwear options available. I can find everything I need for my job, from safety gear to outerwear.',	4,	NULL,	1,	7,	NULL,	'2025-03-17 23:33:22',	'2025-03-17 23:36:21'),
(10,	0,	'Joe Gerrad',	'Guard',	'I appreciate the variety of sizes and styles available. It\'s great to find workwear that fits well and looks good.',	5,	NULL,	1,	7,	NULL,	'2025-03-17 23:35:47',	'2025-03-17 23:35:47');
